import React from "react";
import styled from "styled-components";

function Sidebar_Channel({ id, channel }) {
  return (
    <Container>
      <h4>
        <span>#</span>Youtube
      </h4>
    </Container>
  );
}

const Container = styled.div`
  h4 {
    display: flex;
    padding-left: 15px;
    align-items: center;
    background-color: #2f3135;
    color: gray;
    cursor: pointer;
  }
  h4:hover {
    color: white;
    background-color: #40464b;
  }
  span {
    font-size: 30px;
    padding: 8px;
  }
`;

export default Sidebar_Channel;
